import{OsExperienceGraphModel}from"../../model/graph/os-experience-graph-model.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";class OsExperienceGraphController{constructor(){this.model=new OsExperienceGraphModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://cdn.plot.ly/plotly-latest.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new OsExperienceGraphController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=()=>{const e=(new OsExperienceGraphModel).getDatabaseExperience(),r=[];for(const t in e)r.push({label:t,value:e[t]});r.sort(((e,r)=>r.value-e.value));const t=[{values:r.map((e=>e.value)),labels:r.map((e=>e.label)),type:"pie"}];Plotly.newPlot("graph-container",t,{title:"OS経験"})}}export{OsExperienceGraphController};